type stepInterface = {
   inspire: string;
   plan: string;
   enjoy: string;
   [key: string]: string;
};
const step: stepInterface = {
  inspire: inspire,
  plan: plan,
  enjoy: enjoy,
};

export class TfWelcomeImage extends TfBase {
  constructor() {
    super();
    this.shadowRoot &&
         (this.shadowRoot.innerHTML += html`
            <style>
               ${style}
            </style>
            <div>${step[this.step]}</div>
         `);
  }

  static get observedAttributes() {
    return ['step'];
  }

  attributeChangedCallback(name: string, newValue: string) {
    if (name === 'step') {
      const divElement = this.shadowRoot?.querySelector('div');
      if (divElement) {
        if (step[newValue] === undefined) {
          divElement.innerHTML = step['inspire'];
          return;
        }
        divElement.innerHTML = step[newValue];
      }
    }
  }

  get step() {
    return this.getAttribute('step') || 'inspire';
  }

  set step(val) {
    this.setAttribute('step', val);
  }
}

declare global {
   interface HTMLElementTagNameMap {
      'tf-welcome-image': TfWelcomeImage;
   }
}

customElements.define('tf-welcome-image', TfWelcomeImage);
